export const sixCardItem=(e,t,r)=>{const o=document.querySelector(`${e}`);if(!o)return;const l=o.querySelectorAll(`${t}`);l&&l.forEach(((e,t)=>{if(t<r.length&&t<6){const o=e.querySelector("a"),l=e.querySelector("img"),c=e.querySelector("a span");c.classList.remove("placeholder","bg-secondary","rounded-pill"),l.dataset.src=`/img${r[t].thumbnail}`,c.textContent=r[t].title,o.href=`/${r[t].pathname}/${r[t].page_url}`}else e.remove()}))};